class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        n, m = len(board), len(board[0])
        mx = []
        for v in board:
            ls = []
            for i in range(m):
                ls.append((v[i], i))
            ls.sort(reverse=True)
            mx.append(ls)
        ans = -inf
        for (a, b, c) in combinations(range(n), 3):
            for i in range(3):
                for j in range(3):
                    for k in range(3):
                        if mx[a][i][1] != mx[b][j][1] and mx[b][j][1] != mx[c][k][1] and mx[a][i][1] != mx[c][k][1]:
                            ans = max(mx[a][i][0] + mx[b][j][0] + mx[c][k][0], ans)
        return ans
